def solve_circuit(stabilizers):
    # Parse stabilizers
    num_qubits = len(stabilizers[0])
    
    print(f"Number of stabilizers: {len(stabilizers)}")
    print(f"Number of qubits: {num_qubits}")

    # Create tableau
    try:
        t = stim.Tableau.from_stabilizers(
            [stim.PauliString(s) for s in stabilizers],
            allow_redundant=True,
            allow_underconstrained=True
        )
    except Exception as e:
        print(f"Failed to create tableau from stabilizers: {e}")
        return None
        
    circuit = t.to_circuit(method="elimination")
    return circuit

if __name__ == "__main__":
    try:
        circuit = solve_circuit(stabilizers)
        if circuit:
            print("Circuit generated successfully")
            with open("circuit_clean_135.stim", "w") as f:
                f.write(str(circuit))
        else:
            print("Failed to generate circuit")
    except Exception as e:
        print(f"Error generating circuit: {e}")
